import React from 'react';
import Layout from '../../layout/Layout';
import { Button, Table } from 'react-bootstrap';
import Pagination from 'react-js-pagination';

const User = (props) => {
  const [activePage, setActivePage] = useState(1);
  const [pageLimit, setPageLimit] = useState(5);
  const [totalCount, setTotalCount] = useState(15);
  console.log(props.userData, 'uuuuuuuuuu');
  return (
    <>
      <Layout>
        <Button variant="primary" onClick={props.handleAdd}>
          add
        </Button>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>State</th>
              <th>Title</th>
              <th> Action</th>
            </tr>
          </thead>
          {props.userData &&
            props.userData.map((data) => (
              <tbody>
                <tr>
                  <td>{data.state}</td>
                  <td>{data.title}</td>
                  <td>
                    <Button onClick={() => props.handleEdit(data)}>edit</Button>
                    <Button onClick={() => props.handledelete(data.id)}>
                      Delete
                    </Button>
                  </td>
                </tr>
              </tbody>
            ))}
        </Table>
        <Pagination
          className="text-left"
          itemClass="page-item"
          linkClass="page-link"
          prevPageText="Previous"
          nextPageText="Next"
          // activePage={activePage}
          // itemsCountPerPage={pageLimit}
          // totalItemsCount={totalCount}
          // pageRangeDisplayed={5}
          //onChange={handlePageChange}
        />
      </Layout>
    </>
  );
};
export default User;
